import react from 'react'

import BlogsList from './BlogsList'

const loopTest = (array) => {
    array.map((item, idx) => {
        console.log(item.title.rendered);
    });
}

const BlogsComponent = (props) => {
    console.log(props.posts)
    loopTest();
    return (
        <react.Fragment>
            <div className='blogsContainer'>
                <BlogsList data={props.data}></BlogsList>
            </div>
            <style jsx>{`
                .blogsContainer {
                    // border: blue 2px solid;
                    min-height: 300px;
                }
            `}</style>
        </react.Fragment>
    )
}

export default BlogsComponent;
